import React, {useState, useEffect, useRef} from 'react';
import Header from './header'
import Menu from './menu'
import Profile from './profile'

import '../css/index.css'
import './menu'

function App() {
    return (
        <div className="main">
        <Header />
        <div className="middleBlock">
        <Menu />
        <Profile />
        </div>
      </div>
    )
}

export default App;
